function Productos(prop){
    var imagen=prop.imagen;
    return(

    <div className='tarjeta'>
        <center><img src={require(imagen)} alt="" className='img' /></center>
        <h2>{prop.Nombre}</h2>
    </div>


    )
}
export default Productos;
